import React, { Component } from "react";
import Dropzone from "react-dropzone";
import jsfeat from './jsfeat';

const CANVAS_SIZE = 500;
const DATA_LASER_3 = `data:image/jpeg;base64,`
const DATA_DEAL_WITH_IT = `data:image/png;base64,`;

class App extends Component {
  constructor() {
    super();
    this.state = {
      rects: []
    };
  }

  getRects = img => {
    const MAX_WORK_SIZE = 160;
    const SCALE_FACTOR = 1.15;
    const EDGES_DENSITY = 0.13;
    const MIN_SCALE = 2;

    const scale = Math.min(
      MAX_WORK_SIZE / img.width,
      MAX_WORK_SIZE / img.height
    );
    const w = (img.width * scale) | 0;
    const h = (img.height * scale) | 0;

    const canvas = Object.assign(document.createElement("canvas"), {
      width: w,
      height: h
    });

    const ctx = canvas.getContext("2d");
    ctx.drawImage(img, 0, 0, w, h);

    const ii_sum = new Int32Array((w + 1) * (h + 1));
    const ii_sqsum = new Int32Array((w + 1) * (h + 1));
    const ii_tilted = new Int32Array((w + 1) * (h + 1));
    const img_u8 = new jsfeat.matrix_t(w, h, jsfeat.U8_t | jsfeat.C1_t);
    const classifier = jsfeat.haar.frontalface;

    const imageData = ctx.getImageData(0, 0, w, h);
    jsfeat.imgproc.grayscale(imageData.data, w, h, img_u8);

    jsfeat.imgproc.compute_integral_image(
      img_u8,
      ii_sum,
      ii_sqsum,
      classifier.tilted ? ii_tilted : null
    );

    jsfeat.haar.edges_density = EDGES_DENSITY;

    let rects = jsfeat.haar.detect_multi_scale(
      ii_sum,
      ii_sqsum,
      ii_tilted,
      null,
      img_u8.cols,
      img_u8.rows,
      classifier,
      SCALE_FACTOR,
      MIN_SCALE
    );

    rects = jsfeat.haar.group_rectangles(rects, 1);

    console.log(rects);
    return { rects, rectScale: scale };
  };

  draw = img => {
    const { rects, rectScale } = this.getRects(img);

    const scale = Math.min(CANVAS_SIZE / img.width, CANVAS_SIZE / img.height);
    const w = (img.width * scale) | 0;
    const h = (img.height * scale) | 0;

    this.canvasRef.width = w;
    this.canvasRef.height = h;

    const scaledRects = rects.map(r => ({
      x: r.x / rectScale * scale,
      y: r.y / rectScale * scale,
      width: r.width / rectScale * scale,
      height: r.height / rectScale * scale
    }));

    scaledRects.forEach(r => {
      // ctx.strokeRect(
      //   r.x,
      //   r.y,
      //   r.width,
      //   r.height
      // );
    });

    this.setState(
      {
        rects: scaledRects,
        width: w,
        height: h
      },
      () => {
        const ctx = this.canvasRef.getContext("2d");
        ctx.clearRect(0, 0, w, h);
        ctx.drawImage(img, 0, 0, w, h);
      }
    );
  };

  handleDrop = files => {
    const reader = new FileReader();
    reader.onload = e => {
      const img = new Image();
      img.onload = () => {
        this.draw(img);
      };
      img.src = e.target.result;
    };
    reader.readAsDataURL(files[0]);
  };

  setDropRef = ref => {
    this.dropzoneRef = ref;
  };

  setCanvasRef = ref => {
    this.canvasRef = ref;
  };

  handleOpen = () => {
    this.dropzoneRef.open();
  };

  render() {
    const width = this.state.width || 0;
    const height = this.state.height || 0;
    return (
      <div
        style={{
          height: "100%",
          width: "100%",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          flexDirection: "column"
        }}
      >
        <Dropzone
          disableClick
          disablePreview
          ref={this.setDropRef}
          style={{ width, height, position: "relative" }}
          onDrop={this.handleDrop}
        >
          <canvas ref={this.setCanvasRef} width={width} height={height} />
          {this.state.rects.map((r, idx) => (
            <div
              key={idx}
              style={{
                position: "absolute",
                left: r.x,
                top: r.y - r.height / 7,
                width: r.width,
                height: r.height,
                display: "flex",
                alignItems: "center",
                justifyContent: "center"
              }}
            >
              <img alt="glasses" src={DATA_DEAL_WITH_IT} style={{ maxWidth: "100%" }} />
            </div>
          ))}
          <div
            style={{
              position: "absolute",
              top: 0,
              left: 0,
              width: "100%",
              height: "100%",
              backgroundImage: `url('${DATA_LASER_3}')`,
              backgroundSize: 'cover',
              mixBlendMode: "screen"
            }}
          />
        </Dropzone>
        <button
          style={{
            background: "#eee",
            border: "none",
            padding: "1rem",
            margin: ".5rem",
            fontSize: 16
          }}
          onClick={this.handleOpen}
        >
          Browse...
        </button>
      </div>
    );
  }
}

export default App;
